import { CLASS_NAME } from '../actions/types'
import ClaasJson from '../classroom_data.json'

const initialState = {}


export default function(state = ClaasJson, action) {
    console.log(state)
    switch(action.type) {
        case CLASS_NAME: 
            alert(ClaasJson)
            return {
                ...state,
                markAverage: state
            }
    }
}
